import { useEffect, useState } from "react";
import { fetchLocal } from "../../../helper/httpRequest";

const fake = [
  {
    description: "肝王之王，12案件推到头秃！",
    image:
      "data:image/png;base64,",
  },
];

const usePromotePlaybooks = () => {
  const [promotePlaybooks, setPromotePlaybooks] = useState([]);

  useEffect(() => {
    const fetchPromotePlaybooks = async () => {
      const result = await fetchLocal("promote-playbooks", {}, fake);
      setPromotePlaybooks(result);
    };
    fetchPromotePlaybooks();
  }, []);

  return promotePlaybooks;
};

export default usePromotePlaybooks;
